import makePDF from './pdf'

beforeAll(() => {
  jest.useFakeTimers()
  jest.setSystemTime(new Date(2022, 3, 29))
})

test('matches snapshot', async () => {
  const pdf = await makePDF({
    firstName: 'Some',
    lastName: 'One',
    dob: '01022000',
    email: 'someone@example.com',
    phone: '+447700 900000',
    addressLine1: 'Flat 1 Somewhere House',
    addressLine2: '123 Somewhere Street',
    addressLine3: 'Sometown',
    addressPostcode: 'SW1A 1AA',
    alternativeAddressLine1: 'Other House',
    alternativeAddressLine2: '123 Other Street',
    alternativeAddressPostcode: 'SW1A 2AA',
    alternativeAddressReason: 'Working away from home',
    signatureDataUri: 'data:image/png;base64,',
    date: '29042022',
  })

  expect(pdf.toString('base64'))
    .toMatchInlineSnapshot('""')
})
